(1, 1, 1540567873, 1, 0, 37, 123457, 581, '<h2 style="text-align: center;"><strong>Nos ajude</strong></h2>\r\n<p>&nbsp;</p>\r\n<p>Abriremos o servidor hoje para teste ate a proxima sexta feira para inaugura&ccedil;ao oficial, para os player que participar e reportar bugs iram concorrer premium scroll de 7 a 60 dias, dependendo da sua participa&ccedil;ao e gravidade dos bugs encontrados.</p>\r\n<p>&nbsp;</p>\r\n<p>contamos com a compreen&ccedil;ao de voces e pretendemos ser o melhor ot br dos ultimos tempos.&nbsp;</p>', 'Beta Teste!!', 0, 1, 1540567873, 0, 0, '45.231.22.149', 0, 0),
(2, 2, 1541949623, 1, 0, 60, 123457, 581, '<p>Hello, player!</p>\r\n<p>Welcome to Oldera Online.</p>\r\n<p>A dedicated host server, in the most stable (no reset) and competitive version, with Full Real Tibia map, including all NPCs, Port Hope, monsters and 100% RL Quests.</p>\r\n<p>Are you ready for the adventure?</p>\r\n<p><strong>[Server]</strong></p>\r\n<p>Client: 7.4</p>\r\n<p>Map: 7.4 Global Full.</p>\r\n<p>Rate:</p>\r\n<p>1 to 8 - 20x</p>\r\n<p>8 to 20 - 10x</p>\r\n<p>21 to 30 - 8x</p>\r\n<p>31 to 40 - 6x</p>\r\n<p>41 to 50 - 4x</p>\r\n<p>51 to 80 - 3x</p>\r\n<p>81 + 2x</p>\r\n<p>Runes: 2x</p>\r\n<p>Skills: 5x</p>\r\n<p>Magic: 3x</p>\r\n<p>Loot: 2x</p>\r\n<p><strong>[Information]</strong></p>\r\n<ul>\r\n<li>No protection zone on all Boats and Rugs.</li>\r\n<li>Vocations and Spells with Tibia formula 7.4.</li>\r\n<li>Task System implemented.</li>\r\n<li>Party Sharing Experience party experience earns 30% bonus (! Share).</li>\r\n<li>Auto-stack items</li>\r\n</ul>\r\n<p><strong>[Balancing]</strong></p>\r\n<ul>\r\n<li>Conjure Runes and 2x Ammo.</li>\r\n<li>Conjure Runes in the backpack.</li>\r\n<li>Burst Arrows based on magic level.</li>\r\n<li>Mages conjure more runes. (e.g., adori vita vis = 2 SDs)</li>\r\n<li>Damage increased by 10% for Knights and Paladins.</li>\r\n</ul>\r\n<p><strong>[NPCs]</strong></p>\r\n<ul>\r\n<li>They do not sell runes.</li>\r\n<li>You can buy Mana Fluid in bps: "buy bp mf"</li>\r\n<li>You can buy Life Fluid in bps: "buy bp lf"</li>\r\n<li>You can buy blank rune in bps: "buy bp br"</li>\r\n<li>Rashid is obtained through the '''' Postman '''' quest.</li>\r\n<li>Eremo sells Amulet of Loss.</li>\r\n<li>Stone Skin Amulet does not sell on NPCs, droplets of monsters like Warlock and Hydra.</li>\r\n</ul>\r\n<p>See you in game!</p>', 'Welcome to the game!!', 0, 1, 1541949623, 0, 0, '45.231.20.2', 0, 0);
